#!/bin/bash

THIS_SCRIPT=$(cd $(dirname $0) ; pwd)/$(basename $0)
#XTANT_TO_XSINC=$(cd $(dirname $0) ; pwd)/xtant-to-xsinc.sh

F_XMDYN_grep="\.F"
F_XMDYN=".F"
R_XMDYN=".R"
F_XTANT="_F="
R_XTANT="_v"
COMMENTCHAR="#"

R_DIGITS=7

#if [ -z "$1" ] ; then
#    echo "Usage:"
#    echo "$0 <XTANT_FIRST"
#    exit
#fi

###########################################################################

function get_input()
{
    local FILE FIELD L F V
    FILE="$1"
    FIELD="$2"
    V=
    cat "$FILE" | cut -d"$COMMENTCHAR" -f1 | while read L ; do
        L=$(echo $L)
        if [ ! -z "$L" ] ; then
            F=$(echo $L|cut -d\  -f1)
            if [ $F == $FIELD ] ; then 
                V=$(echo $L|cut -d\  -f2)
                echo $V $L
            fi
        fi
    done
    echo xxx $V
}

###########################################################################

function convert_flu_xtant2xmdyn()
{
    echo $F
}

###########################################################################

function create_links()
{
    local TODO LIST T S R X F ROOT
    TODO=$1 ; shift 1
    LIST="$@"
    echo -ne > ./input_fluence.txt
    echo "$LIST" | while read S ; do
        ROOT=${S%${F_XTANT}*}
        X=${S%${R_XTANT}*}
        R=${S##*${R_XTANT}}
        F=${S##*${F_XTANT}}
        F=${F%${R_XTANT}*}
        # We assume first realization of XTANT has no _v1
        # then we map _v1 to .R0000002, _v2 to .R0000003, etc.
        if [ $R == $S ] ; then  R=0  ; fi
        R=$((R+1))
        R=$(printf %0${R_DIGITS}d $R )
        F=$(convert_flu_xtant2xmdyn $F)
        F=$(printf %1.3e $F)
        #X=$(echo "$X"|sed s/$F_XTANT/$F_XMDYN/)
        #T=${X}${R_XMDYN}${R}
        T=${ROOT}${F_XMDYN}${F}${R_XMDYN}${R}
        #echo  $ROOT === $F === $R
        #echo ln -s $S  $T
        if [ "x$TODO" == xecho ] ; then
            echo "$S   ===>   $ROOT    $F    $R"
        elif  [ "x$TODO" == xsnp ] ; then
            sh $THIS_SCRIPT  snp   $S  #  $XTANT_TO_XSINC  $S
        elif  [ "x$TODO" == xflu ] ; then
            echo $F >> ./input_fluence.txt
        else
            echo ln -s"   "$S"   "$T
            ln -s $S  $T
        fi
    done
}

###########################################################################

function help()
{
echo "
$(basename $0)  XTANT_OUTPUT  -udim UDIM -maxflu FLU -snp SNP -sdim SDIM [-numreal NUMREAL]
      [-lambda LAM] [-duration DUR] [-pcenter PCENT] [-sprofile SPROF] [-tprofile TPROF] 
      [-focus FOC] [-depth DEP] [-seed SEED] [-ncpu NCPU]
   
XTANT_OUTPUT: common part of folder names
              e.g. for folders OUTPUT_t=25.0_F=0.50   ==>  OUTPUT_t=25.0
SNP:   START,DIFF,END     or  SNP
UDIM:  UDIMX,UDIMY,UDIMZ  or  UDIM
SDIM:  SDIMX,SDIMY,SDIMZ  or  SDIM

Units and default values:
  UDIM:    [A] [A,A,A]
  SDIM:    [A] [A,A,A]
  FLU:     [XTANT units]
  SNP:     [fs] [fs,as,fs]
  NUMREAL: $NUM_REAL
  LAM:     $LAMBDA [A]
  DUR:     $DURATION [fs]
  PCENT:   ( END + START ) / 2 [fs]
  SPROF:   $SPROFILE [gaussian  or  flattop]
  TPROF:   $TPROFILE [gaussian  or  flattop]
  FOC:     [A]
    "

}

###########################################################################

function get_param()
{
    local PARAM x y
    PARAM=$1 ; shift 1
    case $PARAM in 
        NumAtoms)  x=$(head -n1 $1/OUTPUT_atomic_coordinates.xyz | xargs ) ;;
    esac
    echo "$x"
}


###########################################################################

function eval_math() 
{
 echo "$@" | sed s/e-/*10^-/g | sed s/e+/*10^/g | sed s/e/*10^/g | bc -l
}

