# see xsinc.c fluence distribution sextion
PI=3.1415926
SIGMA=$( eval_math $FOCUS / 2.35482004503 )  # sigma /sqrt(8 ln2)
case "$SPROFILE" in
    gaussian)  N_PHOTONS=$(eval_math "2 * $PI * $SIGMA * $SIGMA * $MAX_FLU") ;;
    flattop)   N_PHOTONS=$(eval_math "$SIGMA * $SIGMA * $MAX_FLU / 0.8825") ;;
